<!DOCTYPE html>
<html lang="zh-CN">
<head>
<title>故事荟</title>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1,user-scalable=yes">
<style type="text/css">
	.background {
		background-color: #333;
	}
	.all-scope {
		color: white;
		width: 100%;
		position: relative;
	}
	.mobile-text {
		margin-top: 100px;
		text-align: center;
		font-size: 18px;
		height: 200px;
	}
	.text {
		margin-top: 200px;
		text-align: center;
		font-size: 24px;
		height: 200px;
	}
	.btns {
		width: 33.33%;
		margin: 0 auto;
		padding-top: 30px;
	}
	.mobile-btns {
		margin: 0 auto;
		padding-top: 30px;
	}
	.btn {
		float: left;
		display: block;
		width: 30%;
		margin-left: 40px;
		text-align: center;
		height: 30px;
		font-size: 20px;
		border: 1px #ccc solid;
		border-radius: 5px;
	}
	.mobile-btn {
		display: block;
		width: 60%;
		margin: 10px auto;
		text-align: center;
		height: 30px;
		font-size: 20px;
		border: 1px #ccc solid;
		border-radius: 5px;
	}
	.btn:hover {
		background-color: #00FF33;
	}
</style>
<script type="text/javascript">
	var index = 0;
	var paragraphs = ['STORY BEGINS HERE  · · ·'];
	var frameTexts = ['女友说小明太死板，分手啦！！！', '女友说小明做事不懂规矩，分手啦！！！','女友紧紧挽住小明的胳膊。做自己就好，总有个人和你三观一致']
	var goOnTexts = ['继续'];
	var byeTexts = ['拜拜'];
	var choice;
	paragraphs.push("每个故事都有一个小明，这里的主角依然是小明同学。小明从小就是个乖乖仔，遵纪守法。时光荏苒，小明恋爱了。某天，小明陪她去逛街遇到了红灯，他就停下来等，妹子说：“反正没车，我们过吧？”");
	goOnTexts.push('坚守原则，不');
	byeTexts.push('直接过去');
	paragraphs.push('Time flies。小明又找到了个妹子，妹子照例拉他去逛街，又到了红灯口，于是。。。');
	goOnTexts.push('坚守原则，不');
	byeTexts.push('直接过去');

	function letsGo() {
		document.getElementById('frame').style.display = 'block';
		document.getElementById('main').style.display = 'none';
		
		if(index == 1) {
			document.getElementById('frame_text').innerHTML = frameTexts[0];
			document.getElementById('main_text').innerHTML = paragraphs[index + 1];
			document.getElementById('btn_continue').innerHTML = goOnTexts[index + 1];
			document.getElementById('btn_bye').innerHTML = byeTexts[index + 1];
			document.getElementById('failed').style.display = "block";
			document.getElementById('success').style.display = "none";
		} else if (index == 2) {
			if (choice && choice == "0") {
				document.getElementById('frame_text').innerHTML = frameTexts[2];
				document.getElementById('failed').style.display = "none";
				document.getElementById('success').style.display = "block";
				index++;
				return;
			}
			document.getElementById('frame_text').innerHTML = frameTexts[0];
			document.getElementById('failed').style.display = "block";
			document.getElementById('success').style.display = "none";
		} else if (index == 0) {
			document.getElementById('frame').style.display = 'none';
			document.getElementById('main').style.display = 'block';
			document.getElementById('main_text').innerHTML = paragraphs[index + 1];
			document.getElementById('btn_continue').innerHTML = goOnTexts[index + 1];
			document.getElementById('btn_bye').innerHTML = byeTexts[index + 1];
		}
		index++;
		choice = "0";
	}

	function sayBye() {
		document.getElementById('frame').style.display = 'block';
		document.getElementById('main').style.display = 'none';
		if(index == 1) {
			document.getElementById('frame_text').innerHTML = frameTexts[1];
			document.getElementById('main_text').innerHTML = paragraphs[index + 1];
			document.getElementById('btn_continue').innerHTML = goOnTexts[index + 1];
			document.getElementById('btn_bye').innerHTML = byeTexts[index + 1];
			document.getElementById('failed').style.display = "block";
			document.getElementById('success').style.display = "none";
		} else if (index == 2) {
			if (choice && choice == "1") {
				document.getElementById('frame_text').innerHTML = frameTexts[2];
				document.getElementById('failed').style.display = "none";
			document.getElementById('success').style.display = "block";
				index++;
				return;
			}
			document.getElementById('frame_text').innerHTML = frameTexts[1];
			document.getElementById('failed').style.display = "block";
			document.getElementById('success').style.display = "none";
		} else if (index == 0) {
			window.location.href="about:blank";
			window.close();
		}
		index++;
		choice = "1";
	}

	function goON() {
		if (index == paragraphs.length) {
			window.location.href="about:blank";
			window.close();
		}
		document.getElementById('frame').style.display = 'none';
		document.getElementById('main').style.display = 'block';
	}
</script>

	<script type="text/javascript">
		if (window.innerWidth < 800) {
			document.getElementById('images').style.display = 'none';
			document.getElementById('main_text').className = 'mobile-text';
			var objs = []; 
			objs = document.getElementsByClassName('btns');
			var first_in_length = objs.length;
			for (var i =0; i < first_in_length; i++) {
				objs[0].className = 'mobile-btns';
			}
			var objs_btn = [];
			objs_btn = document.getElementsByClassName('btn');
			var first_in_btns_length = objs_btn.length;
			for (var j =0; j < first_in_btns_length; j++) {
				objs_btn[0].className = 'mobile-btn';
			}
		}
		document.getElementById('frame').style.display = 'none';
	</script>
